import React, { useEffect, useState } from 'react';
import { getProfiles } from './services/service';

const Main = () => {
    const [data,setData]=useState([]);
    useEffect(()=>{
        getProfiles().then((res)=>{
setData(res.data);
console.log(res.data);
        });
    },[])
    return (
        <>
            {data.map((item,index)=>{
                return(
                <div key={index}>{item.name}</div>
                );
            })}
        </>
    );
};

export default Main;
